import React, { Component } from "react";
import '../styles/app.css';
import DataChange from './DataChange'
import FetchData from "./FetchData";
import 'bootstrap/dist/css/bootstrap.min.css';



class App extends Component {
  state = {
    url: null
  }

  changeState() {
    this.setState({
      url: 'data-min'
    });
  }

  render() {
    return (
      <div className="App">
      {/* <DataChange /> */}
      <div>
        <button onClick={this.changeState.bind(this)}>
          Test
        </button>
      </div>
        <div className="table table-striped">
          <table>
            <thead className="thead-light">
              <tr className="table-articles">
                <td>id</td>
                <td>firstName</td>
                <td>lastName</td>
                <td>email</td>
                <td>phone</td>
              </tr>
            </thead>
            <tbody>
            <FetchData urlType = {this.state.url} ref={(fetchData) => {this._fetchData = fetchData}}/>
            </tbody>
          </table>
        </div>
      </div>
    );
  }
}

export default App;
